import React from 'react';
import { Container, Box, Tabs, Tab } from '@material-ui/core';

export class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value: "Home"
    }
  }

  handleChange(event, newValue){
    this.setState(newValue);
  }

  render() {
    return (
      <Container
      maxWidth={false}
      disableGutters={true}
      bgcolor="#263238">
        <Box
        color="#b0bec5"
        bgcolor="#455a64"
        style={{height:"40%"}}
        paddingTop="10%">
          <Tabs
          centered
          indicatorColor="#b0bec5"
          textColor="#b0bec5">
            <Tab label="Coderals" />
            <Tab label="Apps" />
            <Tab label="Privacy Policy" />
          </Tabs>
        </Box>
        <Box
        color="red"
        bgcolor="#90a4ae"
        >
        </Box>
      </Container>
    );
  }
}
